INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 1, 0, "2015/12/17 15:00:00", 0.0, 0.0, 7001, "2030/12/17 14:59:59", -363.0, "キャル", 106001, 0);
