INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 2, 0, "2015/12/17 15:00:00", 0.0, 0.0, 13003, "2030/12/17 14:59:59", -363.0, "シェフィ", 106401, 2104010);
