INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 1, 10011, "2019/01/31 12:00:00", 4.08, 8.0, 24001, "2030/12/17 14:59:59", -385.0, "エリコ（バレンタイン）", 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 1, 10011, "2019/01/31 12:00:00", 5.0, 8.0, 24002, "2030/12/17 14:59:59", -385.0, "エリコ（バレンタイン）", 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (3, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 1, 10011, "2019/01/31 12:00:00", 10.11, 8.0, 24003, "2030/12/17 14:59:59", -385.0, "エリコ（バレンタイン）", 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 1, 10011, "2019/01/31 12:00:00", 4.0, 8.0, 24004, "2030/12/17 14:59:59", -385.0, "エリコ（バレンタイン）", 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 1, 10011, "2019/01/31 12:00:00", 6.0, 8.0, 24005, "2030/12/17 14:59:59", -385.0, "エリコ（バレンタイン）", 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (6, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 1, 10011, "2019/01/31 12:00:00", 0.0, 0.0, 24006, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (7, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 1, 10011, "2019/01/31 12:00:00", 0.0, 0.0, 24007, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 1, 10011, "2019/01/31 12:00:00", 0.0, 0.0, 24008, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (9, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 1, 10011, "2019/01/31 12:00:00", 0.0, 0.0, 24009, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 1, 10011, "2019/01/31 12:00:00", 0.0, 0.0, 24010, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 1, 10011, "2019/01/31 12:00:00", 2.12, 8.0, 24011, "2030/12/17 14:59:59", -385.0, "シズル（バレンタイン）", 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 5, 10011, "2019/01/31 12:00:00", 4.19, 8.0, 24012, "2030/12/17 14:59:59", -385.0, "シズル（バレンタイン）", 109101, 0);
