INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 1, 0, "2015/12/17 15:00:00", 0.0, 0.0, 46001, "2030/12/17 14:59:59", -371.5, "アメス", 123001, 0);
