INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (1, 2, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47, 1, 0, "2015/12/17 15:00:00", 9.32, 0.0, 47002, "2030/12/17 14:59:59", -416.5, "リノ", 101101, 0);
